import React from 'react';
import { useFormik } from 'formik';

const Signup = () => {
    const formik = useFormik({
        initialValues: {
            firstName: "",
            lastName: "",
            email: "",
            password: "",
            favSeason: "",
        },
        onSubmit: (values) => {
            console.log(values);
        }
    });
    
    return (
        <form>
            <div className="container">
                <div className="row">
                    {/*first name*/}
                    <input className="col-md-6"
                        id="firstName"
                        name="firstName"
                        type="text"
                        placeholder="First Name"
                        onChange={formik.handleChange}
                        value={formik.values.firstName} />

                    {/*last name*/}
                    <input className="col-md-6"
                        id="lastName"
                        name="lastName"
                        type="text"
                        placeholder="Last Name"
                        onChange={formik.handleChange}
                        value={formik.values.lastName} />

                    {/*email*/}
                    <input className="col-md-6"
                        id="email"
                        name="email"
                        type="email"
                        placeholder="email"
                        onChange={formik.handleChange}
                        value={formik.values.email} />

                    {/*password*/}
                    <input className="col-md-6"
                        id="password"
                        name="password"
                        type="password"
                        placeholder="password"
                        onChange={formik.handleChange}
                        value={formik.values.password} />

                    {/*favourite season*/}
                    <select className="col-md-6"
                        id="favSeason"
                        name="favSeason"
                        onChange={formik.handleChange}
                        value={formik.values.favSeason}
                        onBlur={formik.handleBlur}
                    >
                        <option value="" label="Select a season" />
                        <option value="Spring" label="Spring" />
                        <option value="Summer" label="Summer" />
                        <option value="Fall" label="Fall" />
                        <option value="Winter" label="Winter" />
                    </select>
                </div>
            </div>
            <button type="submit">Submit</button>
        </form>
    );
}

export default Signup;
